</html:div>
<html:div class="inner">
<html:form action="/orangehrm-4.3.1/symfony/web/index.php/performance/addPerformanceTracker" id="frmaddPerformanceTracker" method="post" name="frmaddPerformanceTracker">
<html:input id="addPerformanceTracker__csrf_token" name="addPerformanceTracker[_csrf_token]" type="hidden" value="372167dc4aeb2147a052ef197c7fda60" /> <html:input id="addPerformanceTracker_hdnTrckId" name="addPerformanceTracker[hdnTrckId]" type="hidden" /><html:input id="addPerformanceTracker_hdnMode" name="addPerformanceTracker[hdnMode]" type="hidden" /><html:input id="addPerformanceTracker__csrf_token" name="addPerformanceTracker[_csrf_token]" type="hidden" value="372167dc4aeb2147a052ef197c7fda60" />
<html:fieldset>
<html:ol>
<html:li>
<html:label for="addPerformanceTracker_tracker_name">Tracker Name <html:em>*</html:em></html:label> <html:input class="formInput" id="addPerformanceTracker_tracker_name" maxlength="200" name="addPerformanceTracker[tracker_name]" type="text" /> </html:li>
<html:li>
<html:label for="addPerformanceTracker_employeeName">Employee Name <html:em>*</html:em></html:label>
<html:input class="formInput" id="addPerformanceTracker_employeeName_empName" maxlength="52" name="addPerformanceTracker[employeeName][empName]" type="text" value="" />
<html:input id="addPerformanceTracker_employeeName_empId" name="addPerformanceTracker[employeeName][empId]" type="hidden" value="" />
<html:script type="text/javascript">

            var employees_addPerformanceTracker_employeeName = [];

            $(document).ready(function() {

                var nameField = $("#addPerformanceTracker_employeeName_empName");
                var idStoreField = $("#addPerformanceTracker_employeeName_empId");
                var typeHint = 'Type for hints...';
                var hintClass = 'inputFormatHint';
                var loadingMethod = 'ajax';
                var loadingHint = 'Loading';

                if (idStoreField.val() != '') {
                    idStoreField.data('item.name', nameField.val());
                }

                nameField.data('typeHint', typeHint);
                nameField.data('loadingHint', loadingHint);

                nameField.one('focus', function() {

                        if ($(this).hasClass(hintClass)) {
                            $(this).val("");
                            $(this).removeClass(hintClass);
                        }

                    });

                if( loadingMethod != 'ajax'){
                    if (nameField.val() == '' || nameField.val() == typeHint) {
                        nameField.val(typeHint).addClass(hintClass);
                    }



                    nameField.autocomplete(employees_addPerformanceTracker_employeeName, {

                        formatItem: function(item) {
                            return $('&lt;div/&gt;').text(item.name).html();
                        },
                        formatResult: function(item) {
                            return item.name
                        }
                      ,matchContains:true
                        }).result(function(event, item) {
                            idStoreField.val(item.id);
                            idStoreField.data('item.name', item.name);
                        }

                    );
                 }else{
                        var value = nameField.val().trim();
                        nameField.val(loadingHint).addClass('ac_loading');
                        $.ajax({
                               url: "/orangehrm-4.3.1/symfony/web/index.php/pim/getEmployeeListAjax",
                               data: '',
                               dataType: 'json',
                               success: function(employeeList){

                                     nameField.autocomplete(employeeList, {

                                                formatItem: function(item) {
                                                    return $('&lt;div/&gt;').text(item.name).html();
                                                },
                                                formatResult: function(item) {
                                                    return item.name
                                                }

                                                ,matchContains:true
                                            }).result(function(event, item) {
                                                idStoreField.val(item.id);
                                                idStoreField.data('item.name', item.name);
                                            }

                                        );
                                         nameField.removeClass('ac_loading'); 

                                         if(value==''){
                                            nameField.val(typeHint).addClass(hintClass);
                                         } else {
                                            nameField.val(value).addClass();
                                         }
                                    }
                             });
                 }

            }); // End of $(document).ready


        </html:script>
